text:
sisterhoods al festival de cançó barnasants 2019: 
un espectacle poètic i musical format per txell sota (cantant i actriu) i silvia bel (poeta) que s'uneixen en ple moviment feminista #metoo. d'aquest acompanyament se’n diu "sororitat" (sisterhood", en anglès). valentes decideixen pujar al mateix tren i apuntar cap al centre de la vida amb les seves fletxes amniòtiques (música i paraula, cançó i poesia, amb pinzellades d'humor). s'acompanyen de pol oñate al piano i maria rosa pons al violoncel. 
ens presentaran cançons del disc de la cantautora txell sota “no sembles tu” i del poemari de sílvia bel fransi “deixar anar”. donada la data assenyalada, estrenaran la cançó inèdita “escletxa” per la llibertat de persones exiliades i preses polítiques, i algun cop d’estat poètic.

dissabte 23 de febrer 2019
hora: 19:45 h
lloc: centre cultural albareda
link venda entrades:
https://barnasantstickets.cat/ca/events/silvia-bel-i-txell-sota

clip projecte:
https://www.youtube.com/watch?v=ht5xoqd3kty&t=11s

més informació:
lourdes sensarrich i roset
galàxia management
telf. 636 919 373
e-mail: info@galaxiamanagement.com
